import styled from "@emotion/styled";

export const Title = styled.h2`
  color: black;
  font-size: 25px;
`;

export const List = styled.ul`
  display: flex;
  gap: 10px;
`;

export const Item = styled.li``;

export const Btn = styled.button`
  background-color: transparent;
  width: 50px;
  border-radius: 5px;
  padding: 2px;
  cursor: pointer;
`;
